FeedPackage.Description:
Copies the values of the source's object to the target object (Framework version: 4.5)
example:
Book book = context.Books.Find(id);
BookViewModel bookVM = new BookViewModel();
bookVM.ChargeFrom(book);

//done. now bookVM has the same value as the book object

FeedPackage.ReleaseNotes:
1. Added support of the JsRT version of Chakra;
2. Now the MSIE JavaScript Engine can work in 4 modes: `Auto` (selected by default), `Classic`, `ChakraActiveScript` and `ChakraJsRt`;
3. Following methods are obsolete: `HasProperty`, `GetPropertyValue`, `SetPropertyValue` and `RemoveProperty`.

1. Removed following methods: `HasProperty`, `GetPropertyValue`, `SetPropertyValue` and `RemoveProperty`;
2. Fixed bug #3 "execute code from different threads";
3. Now in the `ChakraJsRt` mode is available a more detailed information about errors;
4. In ECMAScript 5 Polyfill improved a performance of the `String.prototype.trim` function;
5. JSON2 library was updated to version of February 4, 2014.

1. Added the `EmbedHostObject` method (embeds a instance of simple class, structure or delegate to script code);
2. Added the `EmbedHostType` method (embeds a host type to script code);
3. Added a possibility to debug in Visual Studio by adding the `debugger` statement to script code. This feature only works in the `ChakraIeJsRt` and `ChakraEdgeJsRt` modes.
4. In JavaScript engine settings was added one new property - `EnableDebugging` (default `false`);
5. Improved implementation of the `CallFunction` method for Chakra JsRT modes.

1. Added support of .NET Core 1.0.3;
2. Downgraded .NET Framework version from 4.5.1 to 4.5;
3. Now when you call the overloaded version of the `ExecuteResource` method, that takes the type, need to pass the resource name without the namespace;
4. Fixed a error “Out of stack space”;
5. JSON2 library was updated to version of October 28, 2016.

1. Added support of .NET Core 1.0.4;
2. In JsRT modes now script error contains a full stack trace;
3. In `MsieJsEngine` class was added overloaded versions of the `Evaluate`, `Evaluate<T>` and `Execute` methods, which take the document name as second parameter;
4. Now all modes support the possibility to debug in Visual Studio by adding the `debugger` statement to script code.

1. Switched to Apache license;
2. In JsRT modes fixed a problems in calculation of error locations;
3. An attempt was made to prevent occurrence of the access violation exception;
